from flask import Blueprint,render_template,redirect,url_for
from utils.db import db

Fermag_servicios = Blueprint("Fermag_servicios",__name__)



class Servicios:
    def __init__(self,nombre, fondo):
        self.nombre = nombre
        self.fondo = fondo

        

    def __str__(self):
        return f'{self.nombre}, {self.fondo}'

@Fermag_servicios.route("/clientes/Fermag/servicios")    
def FermagServicios():
    infos = [ 
        Servicios('DOMOTICA', 'data:image/jpeg;base64,'),
        Servicios('ENERGIAS RENOVABLES', 'data:image/jpeg;base64,'),
        Servicios('INSTALACIONES ELECTRICAS', 'data:image/jpeg;base64,'),
        Servicios('BMS', 'https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcQpKdt7Xpf1mmqpcID9ol0TbJhzo9RGyfoQtA&usqp=CAU'), Servicios('AUTOMOTIZACIONES ESPECIALES', 'https://www.autoavance.co/wp-content/uploads/2019/07/herramientas-de-taller-uso.jpg')             
        ]
    
    return render_template("clientes/Fermag/servicios.html", infos=infos)